import React, { useContext }  from 'react';
import { RootStoreContext } from '../../store/rootStore';
import "./assets/index.css"
import { observer } from "mobx-react";
import { toJS } from 'mobx';



const Header = observer(() => {
  const rootStore = useContext(RootStoreContext);
  const data = toJS(rootStore);
  console.log(data.userInfo);

  const checkRenderUserAction = () => {
    var HTMLUserAction = ''
    if (!data.userInfo) {
        HTMLUserAction = 
        <div className='flex gap-10 justify-end items-center'>
            <div  className='font-mono text-[22]'>
               <p> You are currently not logged in. Joy our journey by</p>
            </div>
            <div className='flex gap-8 justify-end items-center'>
                <a href="/login">
                    <p className='text-shadow user-action-link font-mono text-[blue] font-bold text-[24px] transition-all duration-150 hover:mb-2'>
                        Login
                    </p>
                </a>
                <p className='text-[20px] text-[grey]'>
                    or
                </p>
                <a href="/register">
                    <button
                        className="text-shadow user-action-link font-mono text-[blue] font-bold text-[24px] transition-all duration-150 hover:mb-2"
                        type="button"
                    >
                    Register
                </button>
                </a>
            </div>
        </div>
    }
    return HTMLUserAction;
  }

  return (
    <div className='w-screen fixed z-50 h-[80px] bg-white top-0'>
        <div className='w-full flex justify-between py-1 px-[40px] h-full items-center'>
            <div>
                <div className=" animate-charcter-logo flex flex-col">
                  <p className="self-start text-[20px]">Funny</p>
                  <p className="self-start pl-[50px] text-[20px]">movies</p>
                </div>
            </div>
            <div>
               {checkRenderUserAction()}
            </div>
        </div>
    </div>
  );
});

export default Header;
